import React, { Component } from "react";

class Homepage extends Component {
  render() {
    // let ramoStyle = {
    //   fill: "none",
    //   stroke: "#707070",
    //   strokeWidth: 0.35,
    //   opacity: 0.3
    // };
    //
    // let lessOpacity = {
    //   fill: "none",
    //   stroke: "#707070",
    //   strokeWidth: 0.2,
    //   opacity: 0.1
    // };
    return (
      <div className="Homepage">
        <div className="borboletas">
          <div className="borboleta borboleta-1">
            <div className="wing wing-1">
              <svg height="40" width="70">
                <polygon points="30,40 40,10 70,39" />
              </svg>
            </div>
            <div className=" wing wing-2">
              <svg height="40" width="70">
                <polygon points="0,40 30,0 70,0" />
              </svg>
            </div>
          </div>
        </div>
        <div className="water" />
        <div className="content">
          <h1 className="orbitron">Insecta</h1>
          <h2>Ricardo Lu√≠s Oliveira</h2>
        </div>
        <div className="borboletas" />
      </div>
    );
  }
}

export default Homepage;
